import {FETCH_DRIVERS} from "./types";
import {DRIVERS_API} from "../../shared/contants/apis";

interface DriversFetchAction {
    type: typeof FETCH_DRIVERS;
}

export const fetchDrivers = (): DriversFetchAction  => {
    const response = fetch(DRIVERS_API);
    console.log(response);

    return {
        type: FETCH_DRIVERS,
        payload: [{
            id:1,
            name:'sem',
            age: 12,
            location: {
                lan: 12,
                long: 14
            },
            picture: 'sss',

        }]
    };
};
